B.Va=new A.aU('Esses quilombos estabeleceram in\xfameras povoa\xe7\xf5es ao longo da bacia do Trombetas e do Erepecur\xfa. Inicialmente seus assentamentos ficavam acima das cachoeiras, nas "\xe1guas bravas", com suas localidades chamadas de mocambos e seus moradores de mocambeiros. Para eles, a floresta significou liberdade e suporte para a vida. A dificuldade de acesso os protegia das expedi\xe7\xf5es que visavam destruir os mocambos.No final do s\xe9culo XIX e in\xedcio do s\xe9culo XX, os quilombolas desceram as cachoeiras para ficar mais pr\xf3ximos da cidade para realizar transa\xe7\xf5es comerciais. Neste mesmo per\xedodo, as terras do Baixo e M\xe9dio Trombetas estavam sendo adquiridas por colonizadores interessados nos produtos da floresta, notadamente a madeira e a castanha-do-brasil. Desde ent\xe3o, acirraram-se os conflito pela terra das comunidades remanescentes de quilombos da regi\xe3o, que chegou a abrigar o que foi considerado o "Quilombo dos Palmares da Amaz\xf4nia". Algumas dessas comunidades s\xe3o t\xe3o importantes nos dias atuais, que formam distritos administrativos, como \xe9 o caso de Cachoeira Porteira.',null,null,B.b7,null,null,null,null,null)
