B.Vf=new A.aU("Com o crescimento da povoa\xe7\xe3o de Uru\xe1 Tapera Nove anos depois da sua funda\xe7\xe3o e tendo uma evolu\xe7\xe3o significativa despertava a aten\xe7\xe3o da Provincia do Par\xe1 a ent\xe3o povoa\xe7\xe3o foi elevada \xe0 Freguesia de Santo Ant\xf4nio de Uru\xe1-Tapera, por ato de Joaquim da Costa Barradas, Presidente da Prov\xedncia do Par\xe1 e Desembargador do Estado Do Maranh\xe3o. Freguesia criada com a denomina\xe7\xe3o de Santo Ant\xf4nio do Uru\xe1-Tapera, pela lei n\xba 1288, de 11-1886. Com este reconhecimento estadual tornou-se decisivo passo no desenvolvimento cada vez mais elevado da localidade alcan\xe7ando notoridade politica no contexto regional.",null,null,B.b7,null,null,null,null,null)
