B.Vs=new A.aU("Com a extin\xe7\xe3o de Oriximin\xe1, em 1900 pela lei n\xba 729, de 03-04-1900 e pelas a\xe7\xf5es politicas dos antigos politicos de \xd3bidos que viam o desenvolvimento de Oriximin\xe1 como uma amea\xe7a aos anseios obidenses e o munic\xedpio esperimentava notorio desenvolvimento teve sua soberania cassada o seu territ\xf3rio foi dividido entre os munic\xedpios de Faro e \xd3bidos.\n Por\xe9m, ficou anexado ao de \xd3bidos por mais de 30 anos tendo sofrido atraso no seu desenvolvimento e mesmo asssim o povo de Oriximin\xe1 jamais desistiu de reconquistar sua independ\xeancia O top\xf4nimo de origem ind\xedgena \xe9 de dif\xedcil identifica\xe7\xe3o. \n Em divis\xe3o administrativa referente ao ano de 1911, o distrito de Oriximina figura no munic\xedpio \xd3bidos. Assim permanecendo em divis\xe3o administrativa referente ao ano de 1933.",null,null,B.b7,null,null,null,null,null)
