B.Vd=new A.aU("Localizado na zona fisiogr\xe1fica do Baixo Amazonas, teve in\xedcio em 1877, quando o Padre Jos\xe9 Nicolino de Souza, natural de Faro, desbravou a regi\xe3o e fundou uma povoa\xe7\xe3o denominada Uru\xe1-Tapera ou Mura-Tapera, \xe0 margem esquerda do rio Trombetas.",null,null,B.b7,null,null,null,null,null)
B.LG=new A.be(B.bf,B.Vd,null)
B.UZ=new A.aU('No contexto cronol\xf3gico do Munic\xedpio de Oriximin\xe1 esta forma\xe7\xe3o Primitiva de sua popula\xe7\xe3o pelos nativos os ind\xedgenas das mais diversas etnias que habitavam o territ\xf3rio do atual Munic\xedpio. O processo inicial da coloniza\xe7\xe3o do territ\xf3rio de Oriximin\xe1. O nome Oriximin\xe1 \xe9 de origem ind\xedgena, de proced\xeancia tupi, significando "o macho da abelha", o zang\xe3o. No entanto, frei Prot\xe1sio Frinckel, conhecedor da regi\xe3o e de seus diversos n\xfacleos de habitantes primitivos, inclina-se pela deriva\xe7\xe3o de Eruzu-M Na que significa "muitas praias". Tradicionalmente considera-se que a coloniza\xe7\xe3o das terras de Oriximin\xe1 come\xe7ou com o estabelecimento de v\xe1rios quilombos/mocambos ao longo do rio Trombetas no s\xe9culo XIX.',null,null,B.b7,null,null,null,null,null)
