B.UM=new A.aU("COs desdobramentos e a\xe7\xf5es pol\xedticas da revolu\xe7\xe3o de 1930 tiveram efeito tamb\xe9m no muncipio de Oriximin\xe1 temdo esfor\xe7os desmedidos dos pol\xedticos genuinamente da terra foi e tendo efeito a politica de interioriza\xe7\xe3o do Estado promovido pelo ent\xe3o Interventor Federal do Estado do Par\xe1 Joaquim de Magalh\xe3es Cardoso Barata tendo assumido a governadoria do Estado do Par\xe1 em 12 de Novembro de 1930 e sua preocupa\xe7\xe3o com as povoa\xe7\xf5es ao longo de todo o Territorio Paraense provomoveu a reinstala\xe7\xe3o de diversos Munic\xedpios por todo o estado. \n Elevado novamente \xe0 categoria de munic\xedpio matida a denomina\xe7\xe3o de Oriximin\xe1, pelo decreto estadual n\xba 1442, de 24-12-1934. Em divis\xf5es territoriais datadas de 31-XII-1936 e 31-12-1937, o munic\xedpio \xe9 constitu\xeddo do distrito sede. No quadro fixado para vigorar no per\xedodo de 1944-1948, o munic\xedpio \xe9 constitu\xeddo do distrito sede.\n Em divis\xe3o territorial datada de 1-VII-1960, o munic\xedpio \xe9 constitu\xeddo do distrito sede. Assim permanecendo em divis\xe3o territorial datada de 2007. Santo Ant\xf4nio do Uru\xe1-Tapera para Oriximin\xe1, alterado pela lei n\xba 174, de 09-06-1894 \n A coloniza\xe7\xe3o da regi\xe3o por parte dos europeus se deu a partir de 1877 por a\xe7\xe3o do padre Jos\xe9 Nicolino de Sousa, nascido no munic\xedpio de Faro a partir de ascend\xeancia ind\xedgena. O padre fundou uma povoa\xe7\xe3o na regi\xe3o, denominando-a Uru\xe1-Tapera ou Mur\xe1-Tapera.",null,null,B.b7,null,null,null,null,null)
