B.Vc=new A.aU("Com desenvolvimento populacional e politico da pavoa\xe7\xe3o de Santo Ant\xf4nio de Urua Tapera levou ja na Rep\xfablica o Estado do Par\xe1 A intervir de forma possitiva na vida administrativa na nascente povoa\xe7\xe3o elevando a categoria de Vila modificando tamb\xe9m sua denomina\xe7\xe3o para Oriximin\xe1. Ainda no mesmo ano a vila de Oriximin\xe1 foi elevada a Municipio, cuja instala\xe7\xe3o deu-se no dia 05 de Dezembro de 1894. Mantendo os mesmos limites da \xe9poca da cria\xe7\xe3o da Freguesia abrangiam o rio Trombetas, igarap\xe9 Sapucu\xe1 e Maria Pixi, com respectivo lago, at\xe9 a boca do igarap\xe9 Timb\xf3, seguindo ao Centro. Elevado \xe0 categoria de vila com a denomina\xe7\xe3o de Oriximin\xe1, pela lei n\xba 174, de 09-06- 1894. Instalado em 05-12-1894..",null,null,B.b7,null,null,null,null,null)
